import React from 'react';
import {
    Box,
    Button
} from '@mui/material';

const aboutStyle = {
    width: '100%',
    display: 'block',
    color: 'white',
    backgroundColor: 'rgb(10, 33, 77)', //primary - doesn't want to import
    padding: '1.6rem',
    fontSize: '1.5rem',
    fontFamily: 'Monda',
    fontWeight: '600',
    border: 'solid rgb(0, 0, 0) 3px'
}

const About = () => {

    return (
        <Box
            // sx={aboutStyle}
        >
            <Button
                sx={aboutStyle}
            >
                About Me
            </Button>
        </Box>
    );
};

export default About;
